import { render } from "@testing-library/react";
import React from "react";
import react from "react";
import './TodoSearch.css';


class Componente extends React.Component{//Asi se trabajaba antes para crear componentes en React
    constructor() {
        this.state = {
            patitio: 'Juan'
        };
    }

    render() {
        return (
            <div onClick={() => this.setState('Enrique')}>{this.state.patito}</div>
        )
    }
}

function TodoSearch(){

    const [patito, setPatito] = React.useState('Juan');


    const onSearchValueChange = (event) => {

        console.log(event.target.value);
    };

    return [
        <input 
            className="TodoSearch"
            placeholder="Cebolla"
            onChange={onSearchValueChange} 

        />,
        <p>{patito}</p>
];
}

export {TodoSearch};
